BlocklyGamesMsg["Movie.helpLayer"] = "Перамясьціце фонавае кола ўверх вашай праграмы. Тады яно зьявіцца за чалавекам.";
BlocklyGamesMsg["Movie.helpText1"] = "Карыстайцеся простымі фігурамі, каб намаляваць гэтага чалавечка.";
BlocklyGamesMsg["Movie.helpText2a"] = "Гэты ўзровень зьяўляецца фільмам. Трэба, каб рука чалавека рухалася па экране. Націсьніце кнопку «Прайграць», каб праглядзець.";
BlocklyGamesMsg["Movie.helpText2b"] = "Падчас прагляду фільму, значэньне блёку «time» мяняецца ад 0 да 100. З-за таго што каардыната «y» рукі таксама павінна пачынацца з 0 і дайсьці да 100, гэта павінна быць лёгка.";
BlocklyGamesMsg["Movie.helpText3"] = "Блёк «time» лічыць да 0 да 100. Але цяпер патрабуецца мяняць каардынату «y» іншай рукі ад 100 да 0. Ці можаце вы знайсьці простую матэматычную формулу, каб зьмяніць кірунак руху?";
BlocklyGamesMsg["Movie.helpText4"] = "Карыстайцеся тым, што вы даведаліся на папярэднім узроўні, каб ногі перасекліся.";
BlocklyGamesMsg["Movie.helpText5"] = "Матэматычная формула для рукі складаная. Вось адказ:";
BlocklyGamesMsg["Movie.helpText6"] = "Дадайце чалавеку пару рук.";
BlocklyGamesMsg["Movie.helpText7"] = "Ужывайце блёк «if», каб намаляваць маленькую галаву для першай паловы фільму. Потым намалюйце вялікую галаву для другой паловы фільму.";
BlocklyGamesMsg["Movie.helpText8"] = "Зрабіце, каб ногі былі ў адваротным кірунку ў сярэдзіне фільму.";
BlocklyGamesMsg["Movie.helpText9"] = "Намалюйце кола, якое будзе павялічвацца, за чалавекам.";
BlocklyGamesMsg["Movie.helpText10"] = "Стварыце фільм які пажадаеце. У Вас ёсьць вялікая колькасьць новых блёкаў, якія Вы можаце выкарыстоўваць. Атрымлівайце асалоду!";
BlocklyGamesMsg["Movie.helpText10Reddit"] = "Карыстайцеся кнопкай «Глядзець галерэю», каб паглядзець фільмы іншых людзей. Калі Вы стварылі цікавы фільм, карыстайцеся кнопкай «Захаваць у галерэі», каб яго апублікаваць.";
BlocklyGamesMsg["Music.playNoteTooltip"] = "Грае адну музычную ноту вызначанай працягласьці і вышыні.";
