BlocklyGamesMsg["Music.helpUseFunctions"] = "Вашае рашэньне працуе, але вы можаце зрабіць лепш. Ужывайце функцыі, каб паменшыць аб’ём коду, які паўтараецца.";
BlocklyGamesMsg["Music.helpUseInstruments"] = "Музыка будзе гучаць лепш, калі вы выкарыстаеце розныя інструмэнты для кожнага пачатковага блёку.";
BlocklyGamesMsg["Music.helpText1"] = "Выканаць першыя чатыры ноты «Браткі Якаба».";
BlocklyGamesMsg["Music.helpText2a"] = "«Функцыя» дазваляе вам групаваць блёкі разам, а потым запускаць больш, чым аднойчы.";
BlocklyGamesMsg["Music.helpText2b"] = "Стварыце функцыю, каб граць першыя чатыры ноты «Браткі Якаба». Запусьціце гэтую функцыю двойчы. Не дадавайце ніякіх новых блёкаў нотаў.";
BlocklyGamesMsg["Music.helpText3"] = "Стварыце другую функцыю для наступнай часткі «Браткі Якаба». Апошняя нота больш доўгая.";
BlocklyGamesMsg["Music.helpText4"] = "Стварыце трэцюю функцыю для наступнай часткі «Браткі Якаба». Першыя чатыры ноты больш кароткія.";
BlocklyGamesMsg["Music.helpText5"] = "Завяршыце мэлёдыю «Браткі Якаба» да канца.";
BlocklyGamesMsg["Music.helpText6a"] = "Гэты новы блёк дазваляе вам выкарыстаць іншы музычны інструмэнт.";
BlocklyGamesMsg["Music.helpText6b"] = "Зайграйце сваю мэлёдыю на скрыпцы.";
BlocklyGamesMsg["Music.helpText7a"] = "Гэты новы блёк дадае бязгукавую затрымку.";
BlocklyGamesMsg["Music.helpText7b"] = "Стварае другі пачатковы блёк, які мае два блёкі затрымкі, а потым таксама грае «Братку Якаба».";
BlocklyGamesMsg["Music.helpText8"] = "Кожны пачатковы блёк павінен граць «Братку Якаба» двойчы.";
BlocklyGamesMsg["Music.helpText9"] = "Стварыце чатыры пачатковыя блёкі, кожны зь якіх грае «Братку Якаба» двойчы. Дадайце правільную колькасьць блёкаў затрымкі.";
BlocklyGamesMsg["Music.helpText10"] = "Стварыце тое, што вам хочацца. Вы маеце вялізную колькасьць новых блёкаў для вывучэньня. Атрымлівайце асалоду!";
BlocklyGamesMsg["Music.helpText10Reddit"] = "Выкарыстоўвайце кнопку «Паглядзець галерэю», каб убачыць, што стварылі іншыя людзі. Калі вы складаеце нешта цікавае, выкарыстоўвайце кнопку «Адправіць у галерэю», каб апублікаваць.";
BlocklyGamesMsg["Pond.scanTooltip"] = "Пошук ворагаў. Падайце кірунак (0—360). Вяртае адлегласьць да найбліжэйшага ворага ў гэтым кірунку. Вяртае бясконцасьць, калі вораг ня знойдзены.";
BlocklyGamesMsg["Pond.cannonTooltip"] = "Страляць з гарматы. Падайце кірунак (0—360) і адлегласьць (0—70).";
BlocklyGamesMsg["Pond.swimTooltip"] = "Плысьці наперад. Падайце кірунак (0—360).";
BlocklyGamesMsg["Pond.stopTooltip"] = "Перастаць плысьці. Гулец будзе запавольвацца да спыненьня.";
BlocklyGamesMsg["Pond.healthTooltip"] = "Вяртае стан здароўя гульца (0 — мёртвы, 100 — здаровы).";
BlocklyGamesMsg["Pond.speedTooltip"] = "Вяртае хуткасьць гульца (0 — нерухомы, 100 — максымальная хуткасьць).";
