BlocklyGamesMsg["Pond.pendulumName"] = "Ківач";
BlocklyGamesMsg["Pond.scaredName"] = "Настрашаны";
BlocklyGamesMsg["Pond.helpUseScan"] = "Вашае рашэньне працуе, але можна зрабіць лепей. Выкарыстайце «scan», каб паказаць адлегласьць стральбы гарматам.";
BlocklyGamesMsg["Pond.helpText1"] = "Выкарыстайце каманду «cannon», каб трапіць у мэту. Першы парамэтар — кут, другі парамэтар — адлегласьць. Знайдзі слушныя суадносіны.";
BlocklyGamesMsg["Pond.helpText2"] = "Гэтая мэта павінна быць абстраляная шмат разоў. Выкарыстайце «while (true)», каб рабіць што-небудзь бясконца.";
BlocklyGamesMsg["Pond.helpText3a"] = "Гэты праціўнік рухаецца туды-сюды, з-за чаго ў яго цяжка трапіць. Выраз «scan» вяртае дакладную адлегласьць да праціўніка ў пазначаным кірунку.";
BlocklyGamesMsg["Pond.helpText3b"] = "Адлегласьць — менавіта тое, што трэба камандзе «cannon» для дакладнай стральбы.";
BlocklyGamesMsg["Pond.helpText4"] = "Праціўнік занадта далёка, каб выкарыстаць гармату (якая мае абмежаваньне 70 мэтраў). Замест гэтага выкарыстоўвайце каманду «swim», каб плысьці ў бок праціўніка і зьнішчыць яго.";
BlocklyGamesMsg["Pond.helpText5"] = "Гэты праціўнік таксама занадта далёка, каб выкарыстоўваць гарматы. Але Вы занадта слабы, каб выжыць у сутыкненьні. Плывіце ў бок праціўніка, каб вашае гарызантальнае знаходжаньне было меней чым 50. Потым «stop» і выкарыстайце гармату.";
BlocklyGamesMsg["Pond.helpText6"] = "Гэты праціўнік будзе аддаляцца, калі ў яго трапяць. Плывіце наперад, калі ён знаходзіцца па-за дыяпазонам (70 мэтраў).";
